import React from 'react';
import { Button } from 'react-bootstrap';
import Banner from "../banner/banner.component";

// styles
import "./header.styles.scss";

const Header = () => (
    <header>
        <div className="row no-gutters header-row">
            <div className="header-top col-lg-12">For all the car lovers out there!</div>
        </div>
        <div className="row">
            <div className="col-lg-4"><Button variant="dark">Accessories store</Button> <Button>Premium services</Button></div>
            <div className="col-lg-4 text-center">Service Genie</div>
            <div className="col-lg-4 text-right"><Button>Sign up</Button> <Button>Login</Button></div>
        </div>
        <Banner />
    </header>
);

export default Header;
